import React from "react";
import {
  Box,
  Text,
  Stack,
  useColorMode,
  Image,
  HStack,
  Button,
  Input,
  useDisclosure,
} from "@chakra-ui/react";

// icons
import { BiMenu } from "react-icons/bi";
import { AiOutlineClose } from "react-icons/ai";
import Bag from "../Image/Bag.png";
import User from "../Image/User.png";
import { IconButton, Flex } from "@chakra-ui/react";
import { FiMenu } from "react-icons/fi";

// fonts
import "@fontsource/montserrat";
import "@fontsource/poppins";

// drawer
import {
  Drawer,
  DrawerBody,
  DrawerFooter,
  DrawerHeader,
  DrawerOverlay,
  DrawerContent,
  DrawerCloseButton,
} from "@chakra-ui/react";

// import { ColorModeSwitcher } from "../ColorModeSwitcher";
// import { NavHashLink } from "react-router-hash-link";

// https://github.com/dimitrisraptis96/chakra-ui-navbar/blob/main/src/components/Header.js
// https://raptis.wtf/freebies/color-pairs

function Navbar(props) {
  // eslint-disable-next-line
  const { colorMode, toggleColorMode } = useColorMode();
  const [isOpen, setIsOpen] = React.useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <NavBarContainer
      {...props}
      bg={colorMode === "light" ? "bodyBackground" : ""}
    >
      <LogoComponent />
      <MenuLinks isOpen={isOpen} />
      <MenuToggle toggle={toggle} isOpen={isOpen} />
    </NavBarContainer>
  );
}

const LogoComponent = () => {
  return (
    <Box display="flex" justifyContent="center">
      <a href="/">
        <Text as="h2" fontWeight="500" fontSize="2xl">
          Logo
        </Text>
      </a>
    </Box>
  );
};

const MenuToggle = ({ toggle, isOpen }) => {
  return (
    <>
      <Box
        display={["flex"]}
        alignItems={["center"]}
        justifyContent={{ base: "center" }}
        gap={[".25rem"]}
      >
        <IconComponent />
        {/* <Box display={{ base: "block", md: "none" }} onClick={toggle}> */}
        {/* <Box display={{ base: "block", md: "none" }} onClick={DrawerExample}>
          {isOpen ? <AiOutlineClose size={36} /> : <BiMenu size={36} />}
        </Box> */}
        <DrawerExample isOpen={isOpen}  toggle={toggle}/>
        {/* </Box> */}
      </Box>
    </>
  );
};

const MenuLinks = ({ isOpen }) => {
  return (
    <Box
      // display={{ base: isOpen ? "block" : "none", md: "block" }}
      // flexBasis={{ base: "100%", md: "auto" }}
      display={["none"]}
    >
      <Stack
        fontWeight="500"
        spacing={8}
        align={["flex-end", "center", "center", "center"]}
        justify={["center", "space-around", "space-around", "space-around"]}
        direction={["column", "row", "row", "row"]}
        pt={[4, 4, 0, 0]}
      >
        <a href="/">
          <Text display="block" fontWeight="500">
            Home
          </Text>
        </a>

        <a href="/#Products">
          <Text display="block" fontWeight="500">
            Products
          </Text>
        </a>

        <a href="/#Training">
          <Text display="block" fontWeight="500">
            {/* Training and Consultation */}
            Training
          </Text>
        </a>

        <a href="/#5s-Warm-Up">
          <Text display="block" fontWeight="500">
            5s Learn
          </Text>
        </a>

        {/* <ColorModeSwitcher /> */}
      </Stack>
    </Box>
  );
};

const IconComponent = () => {
  return (
    <>
      <HStack
        gap={["null", ".15rem", ".15rem", ".15rem"]}
        justifyContent={["center", "center", "center", "center"]}
      >
        <Image src={Bag} height="30px" width="auto" />
        <Image src={User} height="30px" width="auto" />
      </HStack>
    </>
  );
};

function DrawerExample() {
  const { isOpen, onOpen, onClose } = useDisclosure();
  const btnRef = React.useRef();

  return (
    <>
      <Box display={{ base: "block", md: "none" }} onClick={toggle}>
        <Box display={{ base: "block", md: "none" }} onClick={DrawerExample}>
          {isOpen ? <AiOutlineClose size={36} /> : <BiMenu size={36} />}
        </Box>
      </Box>
      <Drawer
        isOpen={isOpen}
        placement="right"
        onClose={onClose}
        finalFocusRef={btnRef}
      >
        <DrawerOverlay />
        <DrawerContent>
          <DrawerCloseButton />
          <DrawerHeader>Create your account</DrawerHeader>

          <DrawerBody>
            <Input placeholder="Type here..." />
          </DrawerBody>

          <DrawerFooter>
            <Button variant="outline" mr={3} onClick={onClose}>
              Cancel
            </Button>
            <Button colorScheme="blue">Save</Button>
          </DrawerFooter>
        </DrawerContent>
      </Drawer>
    </>
  );
}

const NavBarContainer = ({ children, ...props }) => {
  return (
    <Box
      display={["flex", "grid", "grid", "grid"]}
      as="nav"
      // for small screen only
      justifyContent={["space-between", "space-between", "space-between"]}
      alignItems={["center", "center", "center", "center"]}
      w="100vw"
      px={["1.4%", "1.5%", "1.6%", "1.8%"]}
      py={["1.4%", "1.5%", "1.6%", "1.8%"]}
      gridTemplateColumns={[
        "null",
        ".5fr 1fr .5fr",
        ".5fr 1fr .5fr",
        ".5fr 1fr .5fr",
      ]}
      fontFamily="montserrat"
      {...props}
    >
      {children}
    </Box>
  );
};

export default Navbar;
